import React, { useState } from "react";

export default function DropdownMapFilter() {
  const [country, setcountry] = useState("");
  const [americaval, setcity] = useState([
    "Sanfranciso",
    "Denvar",
    "california",
  ]);


  const [info, setinfo] = useState("");

  const data = [
    { country: "India", city: ["Mumbai", "Delhi", "Pune"] },
    {
      country: "America",
      city: ["SanFrancisco", "denvar", "NewYork"],
    },
    {
      country: "ENGLAND",
      city: ["London", "Nottingham", "Derby"],
    },
  ];
  return (
    <div>
      <select value={info} onChange={(e) => setinfo(e.target.value)}>
        {data.map((result) => (
          <option>{result}</option>
        ))}
      </select>
      <div></div>
    </div>
  );
}
